description:
The Lord knows the beginning from the end. In a time when culture rejects God and His REVELATION, dig into the Bible and learn His perfect prophecies. Meet a mighty angel from heaven, and discern Tribulation events as we read REVELATION 10 and begin chapter 11. What great opportunity and blessing to investigate the REVELATION of Jesus Christ!
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
